45c057e5-03ae-4a26-a467-b05343cb3bdd.text:
Don't add unneeded context If your class/object name tells you something, don't repeat that in your
variable name. Bad: const Car = {
  carMake: 'Honda',
  carModel: 'Accord',
  carColor: 'Blue'
};

function paintCar(car, color) {
  car.carColor = color;
} Good: const Car = {
  make: 'Honda',
  model: 'Accord',
  color: 'Blue'
};

function paintCar(car, color) {
  car.color = color;
} ⬆ back to top

d619eeda-99ee-437c-8071-af110f8f6a1d.text:
Use default parameters instead of short circuiting or conditionals Default parameters are often cleaner than short circuiting. Be aware that if you
use them, your function will only provide default values for undefined
arguments. Other "falsy" values such as '', "", false, null, 0, and
NaN, will not be replaced by a default value. Bad: function createMicrobrewery(name) {
  const breweryName = name || 'Hipster Brew Co.';
  // ...
} Good: function createMicrobrewery(name = 'Hipster Brew Co.') {
  // ...
} ⬆ back to top

2ca465ae-1055-497c-a77e-86eb3cedc205.text:
Functions should do one thing This is by far the most important rule in software engineering. When functions
do more than one thing, they are harder to compose, test, and reason about.
When you can isolate a function to just one action, it can be refactored
easily and your code will read much cleaner. If you take nothing else away from
this guide other than this, you'll be ahead of many developers. Bad: function emailClients(clients) {
  clients.forEach(client => {
    const clientRecord = database.lookup(client);
    if (clientRecord.isActive()) {
      email(client);
    }
  });
} Good: function emailActiveClients(clients) {
  clients.filter(isActiveClient).forEach(email);
}

function isActiveClient(client) {
  const clientRecord = database.lookup(client);
  return clientRecord.isActive();
} ⬆ back to top

132e5449-fddd-4482-9399-2d1b79e16d13.text:
Function names should say what they do Bad: function addToDate(date, month) {
  // ...
}

const date = new Date();

// It's hard to tell from the function name what is added
addToDate(date, 1); Good: function addMonthToDate(month, date) {
  // ...
}

const date = new Date();
addMonthToDate(1, date); ⬆ back to top

6ba1cd80-45a4-498d-8e74-bd82cbfbd346.text:
Functions should only be one level of abstraction When you have more than one level of abstraction your function is usually
doing too much. Splitting up functions leads to reusability and easier
testing. Bad: function parseBetterJSAlternative(code) {
  const REGEXES = [
    // ...
  ];

  const statements = code.split(' ');
  const tokens = [];
  REGEXES.forEach(REGEX => {
    statements.forEach(statement => {
      // ...
    });
  });

  const ast = [];
  tokens.forEach(token => {
    // lex...
  });

  ast.forEach(node => {
    // parse...
  });
} Good: function parseBetterJSAlternative(code) {
  const tokens = tokenize(code);
  const syntaxTree = parse(tokens);
  syntaxTree.forEach(node => {
    // parse...
  });
}

function tokenize(code) {
  const REGEXES = [
    // ...
  ];

  const statements = code.split(' ');
  const tokens = [];
  REGEXES.forEach(REGEX => {
    statements.forEach(statement => {
      tokens.push(/* ... */);
    });
  });

  return tokens;
}

function parse(tokens) {
  const syntaxTree = [];
  tokens.forEach(token => {
    syntaxTree.push(/* ... */);
  });

  return syntaxTree;
} ⬆ back to top

