dc4cd500-9db2-4a28-b7c9-739180dd972e.text:
Single concept per test Bad: import assert from 'assert';

describe('MomentJS', () => {
  it('handles date boundaries', () => {
    let date;

    date = new MomentJS('1/1/2015');
    date.addDays(30);
    assert.equal('1/31/2015', date);

    date = new MomentJS('2/1/2016');
    date.addDays(28);
    assert.equal('02/29/2016', date);

    date = new MomentJS('2/1/2015');
    date.addDays(28);
    assert.equal('03/01/2015', date);
  });
}); Good: import assert from 'assert';

describe('MomentJS', () => {
  it('handles 30-day months', () => {
    const date = new MomentJS('1/1/2015');
    date.addDays(30);
    assert.equal('1/31/2015', date);
  });

  it('handles leap year', () => {
    const date = new MomentJS('2/1/2016');
    date.addDays(28);
    assert.equal('02/29/2016', date);
  });

  it('handles non-leap year', () => {
    const date = new MomentJS('2/1/2015');
    date.addDays(28);
    assert.equal('03/01/2015', date);
  });
}); ⬆ back to top

40c85599-4a8a-4fed-803c-a1ec6090a609.text:
Use Promises, not callbacks Callbacks aren't clean, and they cause excessive amounts of nesting. With ES2015/ES6,
Promises are a built-in global type. Use them! Bad: import { get } from 'request';
import { writeFile } from 'fs';

get('https://en.wikipedia.org/wiki/Robert_Cecil_Martin', (requestErr, response, body) => {
  if (requestErr) {
    console.error(requestErr);
  } else {
    writeFile('article.html', body, writeErr => {
      if (writeErr) {
        console.error(writeErr);
      } else {
        console.log('File written');
      }
    });
  }
}); Good: import { get } from 'request-promise';
import { writeFile } from 'fs-extra';

get('https://en.wikipedia.org/wiki/Robert_Cecil_Martin')
  .then(body => {
    return writeFile('article.html', body);
  })
  .then(() => {
    console.log('File written');
  })
  .catch(err => {
    console.error(err);
  }); ⬆ back to top

6e11310c-d60e-4207-ac3b-c474662b0615.text:
Async/Await are even cleaner than Promises Promises are a very clean alternative to callbacks, but ES2017/ES8 brings async and await
which offer an even cleaner solution. All you need is a function that is prefixed
in an async keyword, and then you can write your logic imperatively without
a then chain of functions. Use this if you can take advantage of ES2017/ES8 features
today! Bad: import { get } from 'request-promise';
import { writeFile } from 'fs-extra';

get('https://en.wikipedia.org/wiki/Robert_Cecil_Martin')
  .then(body => {
    return writeFile('article.html', body);
  })
  .then(() => {
    console.log('File written');
  })
  .catch(err => {
    console.error(err);
  }); Good: import { get } from 'request-promise';
import { writeFile } from 'fs-extra';

async function getCleanCodeArticle() {
  try {
    const body = await get('https://en.wikipedia.org/wiki/Robert_Cecil_Martin');
    await writeFile('article.html', body);
    console.log('File written');
  } catch (err) {
    console.error(err);
  }
}

getCleanCodeArticle(); ⬆ back to top

b68ea7c5-bd96-4553-a41f-455f798d1c36.text:
Don't ignore caught errors Doing nothing with a caught error doesn't give you the ability to ever fix
or react to said error. Logging the error to the console (console.log)
isn't much better as often times it can get lost in a sea of things printed
to the console. If you wrap any bit of code in a try/catch it means you
think an error may occur there and therefore you should have a plan,
or create a code path, for when it occurs. Bad: try {
  functionThatMightThrow();
} catch (error) {
  console.log(error);
} Good: try {
  functionThatMightThrow();
} catch (error) {
  // One option (more noisy than console.log):
  console.error(error);
  // Another option:
  notifyUserOfError(error);
  // Another option:
  reportErrorToService(error);
  // OR do all three!
}

243aed5e-5e66-44e6-9994-3a65bd534bbe.text:
